To accomplish this, you can use a combination of the following approaches:

1.  **Configuration Manager**: You can create a custom configuration manager class that reads the settings from the SQL server table and applies them to the application settings. This class can be used throughout the application to retrieve and update the settings.

2.  **Dependency Injection**: You can use dependency injection to inject the configuration manager instance into the controllers and services that need to access the settings. This way, you can easily switch between different configuration settings.

3.  **Configuration Provider**: You can create a custom configuration provider that reads the settings from the SQL server table and provides them to the application. This provider can be used to configure the application settings.

Here is an example of how you can implement a configuration manager class:

```csharp
using Microsoft.Extensions.Configuration;
using System.Data.SqlClient;
using System.Threading.Tasks;

public class ConfigurationManager
{
    private readonly string _connectionString;
    private readonly string _tableName;

    public ConfigurationManager(string connectionString, string tableName)
    {
        _connectionString = connectionString;
        _tableName = tableName;
    }

    public async Task<ConfigurationBuilder> GetConfigurationAsync()
    {
        using (var connection = new SqlConnection(_connectionString))
        {
            await connection.OpenAsync();

            using (var command = new SqlCommand($"SELECT * FROM { _tableName }", connection))
            {
                var reader = await command.ExecuteReaderAsync();

                var configuration = new ConfigurationBuilder();

                while (await reader.ReadAsync())
                {
                    var key = reader["Key"].ToString();
                    var value = reader["Value"].ToString();

                    configuration.Add(key, value);
                }

                return configuration.Build();
            }
        }
    }
}
```

