In Java, you can achieve this by using the "access modifier" to restrict the visibility of a method. Here are a few ways to do it:

**Method 1: Using the `private` access modifier**

You can declare a method as `private`, which means it can only be accessed within the same class. This is the most restrictive access modifier, so it's not recommended unless you really need to.

```java
public class MyClass {
    private void myMethod() {
        // method implementation
    }
}
```

**Method 2: Using the `protected` access modifier**

You can declare a method as `protected`, which means it can be accessed within the same class and its subclasses.

```java
public class MyClass {
    protected void myMethod() {
        // method implementation
    }
}
```

**Method 3: Using the `default` access modifier (Java 8 and later)**

You can declare a method as `default`, which means it can be accessed within the same class and its subclasses, as well as by classes in the same package.

```java
public class MyClass {
    default void myMethod() {
        // method implementation
    }
}
```

**Method 4: Using an interface**

You can declare a method as an abstract method in an interface, which means it must be implemented by any class that implements the interface.

```java
public interface MyInterface {
    void myMethod();
}

public class MyClass implements MyInterface {
    @Override
    public void myMethod() {
        // method implementation
    }
}
```

**Method 5: Using a proxy class**

You can create a proxy class that implements the desired behavior and then use it as a substitute for the original class.

```java
public class MyClass {
    public MyClass() {
        // initialization code
    }

    public void myMethod() {
        // method implementation
    }
}

public class MyProxyClass extends MyClass {
    @Override
    public void myMethod() {
        // proxy implementation
    }
}

public class MyClient {
    public void useMyMethod() {
        MyProxyClass proxy = new MyProxyClass();
        proxy.myMethod();
    }
}
```

Note that the last method is more complex and may not be suitable for all use cases.

