in a standard 8x8 checkers board
using a breadth-first search algorithm

```cpp
#include <iostream>
#include <queue>
#include <vector>
#include <unordered_map>

using namespace std;

// Define the possible moves for a piece
const int dx[] = {-1, 1, -1, 1, -1, 1, -1, 1};
const int dy[] = {-1, -1, 1, 1, -1, 1, -1, 1};

// Function to check if a position is valid
bool isValid(int x, int y) {
    return x >= 0 && x < 8 && y >= 0 && y < 8;
}

// Function to check if a position is occupied by a piece of the same color
bool isOccupied(int x, int y, int color) {
    return (x * 8 + y) % 2 == color;
}

// Function to perform the breadth-first search
bool bfs(int x, int y, int color) {
    // Create a queue for BFS
    queue<pair<int, int>> q;
    q.push({x, y});

    // Create a set to keep track of visited positions
    unordered_set<pair<int, int>> visited;

    // Mark the starting position as visited
    visited.insert({x, y});

    // Perform BFS
    while (!q.empty()) {
        int currX = q.front().first;
        int currY = q.front().second;
        q.pop();

        // Check all possible moves from the current position
        for (int i = 0; i < 8; i++) {
            int newX = currX + dx[i];
            int newY = currY + dy[i];

            // Check if the new position is valid
            if (isValid(newX, newY)) {
                // Check if the new position is occupied by a piece of the same color
                if (isOccupied(newX, newY, color)) {
                    // Check if the new position is the 50th square or the 64th square
                    if ((newX * 8 + newY) % 2 == 0 && (newX * 8 + newY) >= 50 && (newX * 8 + newY) <= 64) {
                        return true;
                    }
                }

                // Check if the new position has not been visited before
                if (visited.find({newX, newY}) == visited.end()) {
                    // Mark the new position as visited
                    visited.insert({newX, newY});

                    // Add the new position to the queue
                    q.push({newX, newY});
                }
            }
        }
    }

    // If no path is found, return false
    return false;
}

int main() {
    // Test the function
    cout << boolalpha << bfs(1, 1, 0) << endl;  // 0 represents the color of the piece
    cout << boolalpha << bfs(1, 1, 1) << endl;  // 1 represents the color of the piece

    return 0;
}
```

